  for ease of mapping.  SampleSiteNo in this table maps to SAMPLE_SITE_NO in the larger
  dataset. Note that not all samples in the larger dataset have a match in this table
  ... this table only contains sampling locations with valid latitude/longitude values.
  \ Reasons for samples not having a valid physical location: the data represents
  a non-spatial object like a product or a lab standard or blank; the data was collected
  at a protected karst feature; the data was collected prior to GIS or GPS and the
  information never existed or was lost.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
